import React from 'react';
import imageSrc from '../../images/images/*';
const artcard = (props) => {

    function importAll(r) {
        return r.keys().map(r);
    }
      
    const images = importAll(require.context('../../images/images', false, /\.(png|jpe?g|svg)$/));
    let imgpath = "../../images/images/" + (props.imagename) + '.jpg';
    return(
        <div className="artCard">
            <img src={imgpath}/>
            <h4>{props.name}</h4>
            <p>{props.description}</p>
            <p>{props.price}</p>
        </div>
    );
}

export default artcard;
